import React, { Fragment } from "react";

import Header from "../headerComponents/header";
import Navigation from "./components/navComponents/Navigation";
import Container from "../mainContainer/Container";

const List = () => {
  return (
    <Fragment>
      <Header mode="list" />
      <Navigation />
      <Container mode="list" />
    </Fragment>
  );
};

export default List;
